import React, {Component, Fragment} from "react";
import {Link} from "react-router-dom";
import "./CafeLsit.css";
import Search from "./Components/Search.js";
import CafeList from './App';

class Cafe_Search extends React.Component {
  render() {
    return (
      <div id="bar">
        <center>
          <Search id="searchBar" onCreate={this.handleCreate} />
        </center>

        {/* <CafeList /> */}
      </div>
    );
  }
}

class Cafe_List extends React.Component{
  render(){
    return(
      <div>
        <h4>{this.state.place} 에 대한 검색 결과입니다.</h4>
      </div>
    );
  }
}
export default Cafe_Search;
